import { NgModule } from '@angular/core';
import { RouterModule, Routes } from '@angular/router';
import { HomeComponent } from './pages/home/home.component';

import { CreditComponent } from './pages/credit/credit.component';
import { StatusComponent } from './pages/status/status.component';
import { ArchiveComponent } from './pages/archive/archive.component';
import { SettingsComponent } from './pages/settings/settings.component';
import { DocumentationComponent } from './pages/documentation/documentation.component';
import { ListUserComponent } from './pages/list-user/list-user.component';
import { LoginComponent } from './pages/login/login.component';
import { ListPatientComponent } from './pages/list-patient/list-patient.component';
import { SddiagnosticComponent } from './pages/sddiagnostic/sddiagnostic.component';
import { CartetransfComponent } from './pages/cartetransf/cartetransf.component';
import { ComplicationcoeurComponent } from './pages/complicationcoeur/complicationcoeur.component';
import { IrmcoeurComponent } from './pages/irmcoeur/irmcoeur.component';
import { CompfoieComponent } from './pages/compfoie/compfoie.component';
import { IrmfoieComponent } from './pages/irmfoie/irmfoie.component';
import { GlucidiqueComponent } from './pages/glucidique/glucidique.component';
import { DevpubComponent } from './pages/devpub/devpub.component';
import { ThyroideComponent } from './pages/thyroide/thyroide.component';
import { SurrenalineComponent } from './pages/surrenaline/surrenaline.component';
import { OsComponent } from './pages/os/os.component';
import { CriseComponent } from './pages/crise/crise.component';
import { ThoraciqueComponent } from './pages/thoracique/thoracique.component';
import { AvcComponent } from './pages/avc/avc.component';
import { AgComponent } from './pages/ag/ag.component';
import { InfostComponent } from './pages/infost/infost.component';
import { PulmonaireComponent } from './pages/pulmonaire/pulmonaire.component';
import { MeningiteComponent } from './pages/meningite/meningite.component';
import { AutreinfComponent } from './pages/autreinf/autreinf.component';
import { PriapismeComponent } from './pages/priapisme/priapisme.component';
import { ThromboseretineComponent } from './pages/thromboseretine/thromboseretine.component';
import { ThrenaleComponent } from './pages/threnale/threnale.component';
import { RendementComponent } from './pages/rendement/rendement.component';
import { AutrecompComponent } from './pages/autrecomp/autrecomp.component';
import { UpdatecompcoeurComponent } from './pages/updatecompcoeur/updatecompcoeur.component';
import { UpdateirmcComponent } from './pages/updateirmc/updateirmc.component';
import { UpdatecompfoieComponent } from './pages/updatecompfoie/updatecompfoie.component';
import { UpdateirmfComponent } from './pages/updateirmf/updateirmf.component';
import { UpdateglucidiqueComponent } from './pages/updateglucidique/updateglucidique.component';
import { UpdatedevpubComponent } from './pages/updatedevpub/updatedevpub.component';
import { UpdatethyroideComponent } from './pages/updatethyroide/updatethyroide.component';
import { UpdatesurnComponent } from './pages/updatesurn/updatesurn.component';
import { UpdateosComponent } from './pages/updateos/updateos.component';
import { UpdatecriseComponent } from './pages/updatecrise/updatecrise.component';
import { UpdatethoraciqueComponent } from './pages/updatethoracique/updatethoracique.component';
import { UpdateavcComponent } from './pages/updateavc/updateavc.component';
import { UpdateagComponent } from './pages/updateag/updateag.component';
import { UpdateinfostComponent } from './pages/updateinfost/updateinfost.component';
import { UpdatepulmonaireComponent } from './pages/updatepulmonaire/updatepulmonaire.component';
import { UpdatemenComponent } from './pages/updatemen/updatemen.component';
import { UpdateautinComponent } from './pages/updateautin/updateautin.component';
import { UpdatepriapismeComponent } from './pages/updatepriapisme/updatepriapisme.component';
import { UpdatethromboseComponent } from './pages/updatethrombose/updatethrombose.component';
import { UpdaterenaleComponent } from './pages/updaterenale/updaterenale.component';
import { UpdaterendementComponent } from './pages/updaterendement/updaterendement.component';
import { UpdateautcomComponent } from './pages/updateautcom/updateautcom.component';
import { VisiteComponent } from './pages/visite/visite.component';
import { PrescriptionComponent } from './pages/prescription/prescription.component';
import { PlaintesComponent } from './pages/plaintes/plaintes.component';
import { TreatchelateurComponent } from './pages/treatchelateur/treatchelateur.component';
import { CarnetBilanMensuelComponent } from './pages/carnet-bilan-mensuel/carnet-bilan-mensuel.component';
import { OrdonnancedeSortieComponent } from './pages/ordonnancede-sortie/ordonnancede-sortie.component';
import { BilansPeriodiquePrevuComponent } from './pages/bilans-periodique-prevu/bilans-periodique-prevu.component';
import { UpdatePrescriptionComponent } from './pages/update-prescription/update-prescription.component';
import { UpdatePlainteComponent } from './pages/update-plainte/update-plainte.component';
import { UpdateTreatChelatComponent } from './pages/update-treat-chelat/update-treat-chelat.component';
import { UpdateCBilanMComponent } from './pages/update-cbilan-m/update-cbilan-m.component';
import { UpdateOrdSComponent } from './pages/update-ord-s/update-ord-s.component';
import { UpdatebilanperprevComponent } from './pages/updatebilanperprev/updatebilanperprev.component';
import { VisiteLComponent } from './pages/visite-l/visite-l.component';
import { ListeVisiteByIDComponent } from './pages/liste-visite-by-id/liste-visite-by-id.component';

const routes: Routes = [
  { path: '', component: HomeComponent },
  { path: 'admin/status', component: StatusComponent },
  { path: 'admin/listU', component: ListUserComponent },
  { path: 'admin/login', component: LoginComponent },
  { path: 'admin/archive', component: ArchiveComponent },
  { path: 'admin/diag', component: SddiagnosticComponent },
  { path: 'admin/carteT', component: CartetransfComponent },
  { path: 'admin/coeur', component: ComplicationcoeurComponent },
  { path: 'admin/IrmCoeur', component: IrmcoeurComponent },
  { path: 'admin/foie', component: CompfoieComponent },
  { path: 'admin/IrmFoie', component: IrmfoieComponent },
  { path: 'admin/glucidique', component: GlucidiqueComponent },
  { path: 'admin/devpub', component: DevpubComponent },
  { path: 'admin/thyroide', component: ThyroideComponent },
  { path: 'admin/surn', component: SurrenalineComponent },
  { path: 'admin/os', component: OsComponent },
  { path: 'admin/crise', component: CriseComponent },
  { path: 'admin/thoracique', component: ThoraciqueComponent },
  { path: 'admin/avc', component: AvcComponent },
  { path: 'admin/ag', component: AgComponent },
  { path: 'admin/infost', component: InfostComponent },
  { path: 'admin/pulmonaire', component: PulmonaireComponent },
  { path: 'admin/men', component: MeningiteComponent },
  { path: 'admin/aut', component: AutreinfComponent },
  { path: 'admin/priapisme', component: PriapismeComponent },
  { path: 'admin/thrombose', component: ThromboseretineComponent },
  { path: 'admin/renale', component: ThrenaleComponent },
  { path: 'admin/rend', component: RendementComponent },
  { path: 'admin/autrecomp', component: AutrecompComponent },
  { path: 'admin/updatecompcoeur/:PatientID', component: UpdatecompcoeurComponent },
  { path: 'admin/updateirmc/:PatientId', component: UpdateirmcComponent },
  { path: 'admin/updatecompf/:PatientID', component: UpdatecompfoieComponent },
  { path: 'admin/updateirmf/:PatientId', component: UpdateirmfComponent },
  { path: 'admin/updategluci/:PatientID', component: UpdateglucidiqueComponent },
  { path: 'admin/updatedevp/:PatientID', component: UpdatedevpubComponent },
  { path: 'admin/updatethyroide/:PatientID', component: UpdatethyroideComponent },
  { path: 'admin/updatesurn/:PatientID', component: UpdatesurnComponent },
  { path: 'admin/updateos/:PatientID', component: UpdateosComponent },
  { path: 'admin/updatecrise/:PatientID', component: UpdatecriseComponent },
  { path: 'admin/updatethoracique/:PatientId', component: UpdatethoraciqueComponent },
  { path: 'admin/updateavc/:PatientId', component: UpdateavcComponent },
  { path: 'admin/updateag/:PatientId', component: UpdateagComponent },
  { path: 'admin/updateinfost/:PatientId', component: UpdateinfostComponent },
  { path: 'admin/updatepulmonaire/:PatientId', component: UpdatepulmonaireComponent },
  { path: 'admin/updatemen/:PatientId', component: UpdatemenComponent },
  { path: 'admin/updatautin/:PatientID', component: UpdateautinComponent },
  { path: 'admin/updatepriapisme/:PatientId', component: UpdatepriapismeComponent },
  { path: 'admin/updatethrombose/:PatientId', component: UpdatethromboseComponent },
  { path: 'admin/updaterenale/:PatientId', component: UpdaterenaleComponent },
  { path: 'admin/updaterend/:PatientId', component: UpdaterendementComponent },
  { path: 'admin/updateautcomp/:PatientID', component: UpdateautcomComponent },
  { path: 'admin/visite', component: VisiteComponent },
  { path: 'admin/prescription', component: PrescriptionComponent },
  { path: 'admin/plainte', component: PlaintesComponent },
  { path: 'admin/treatC', component: TreatchelateurComponent },
  { path: 'admin/CbilanM', component: CarnetBilanMensuelComponent },
  { path: 'admin/ordS', component: OrdonnancedeSortieComponent },
  { path: 'admin/bpp', component: BilansPeriodiquePrevuComponent },
  { path: 'admin/updatepresc/:IdVisite', component: UpdatePrescriptionComponent },
  { path: 'admin/updateplainte/:IdVisite', component: UpdatePlainteComponent },
  { path: 'admin/updatetreatC/:IdVisite', component: UpdateTreatChelatComponent },
  { path: 'admin/updateCbilan/:IdVisite', component: UpdateCBilanMComponent },
  { path: 'admin/updateOrds/:IdVisite', component: UpdateOrdSComponent },
  { path: 'admin/updatebpp/:IdVisite', component: UpdatebilanperprevComponent },

  { path: 'admin/listP', component: ListPatientComponent },
  { path: 'admin/visiteL', component: VisiteLComponent },
  { path: 'admin/listeV/:PatientId', component: ListeVisiteByIDComponent },

  { path: 'admin/credits', component: CreditComponent },
  { path: 'admin/settings', component: SettingsComponent },
  { path: 'admin/documentation', component: DocumentationComponent },
];

@NgModule({
  imports: [RouterModule.forRoot(routes)],
  exports: [RouterModule],
})
export class AppRoutingModule {}
